pragma solidity >=0.4.21 <0.6.0;
pragma experimental ABIEncoderV2;

import "./SafeMath.sol";
import "./HybridExchange.sol";

contract TempMatch is LibOrder{
    using SafeMath for uint256;

    uint256 public constant DAY_SECONDS = 24 * 60 * 60;
    uint256 public constant WEEK_SECONDS = DAY_SECONDS * 7;

    uint256 public constant SUPPORTED_ORDER_VERSION = 2;

    // Match info
    struct MatchedInfo{
        uint256 baseTokenFilledAmount;
        uint256 baseTokenAmount;
        uint256 quoteTokenAmount;
        uint256 count;
        bool is_sell;
    }

    // queue element
    struct QueueElem {
        HybridExchange.OrderParam order;
        uint256 filled;
        bytes32 next;
    }

    // queue
    struct Queue{
        mapping(bytes32 => QueueElem) elems;
        bytes32 start;
        bytes32 end;
    }

    //  sell/buy queue 
    mapping(bytes32 => Queue) public sellQueue;
    mapping(bytes32 => Queue) public buyQueue;

    // order flag
    mapping(bytes32 => bool) public orderFlag;

    // address of dex
    HybridExchange public _dex;

    // configurations
    mapping(string => string) public configurations;

    event MakeOrder(bytes32 bq_hash, bytes32 od_hash);
    event CancelOrder(bytes32 bq_hash, bytes32 od_hash);

    /* constructor
     * dex: address of dex
     * */
    constructor (HybridExchange dex) public
    {
        _dex = dex;
    }

    function () external payable
    {
    }

    /* take order
     *
     * return hash of order if doesn't match all quoteTokenAmount
     * */
    function takeOrder(HybridExchange.OrderParam memory takerOrderParam, HybridExchange.OrderAddressSet memory orderAddressSet)
        public
    {
        // hash of base-quote token
        (bytes32 bq_hash, bytes32 od_hash) = getBQODHash(takerOrderParam, orderAddressSet);

        // mark order
        require(!orderFlag[od_hash]);
        orderFlag[od_hash] = true;

        Queue storage queue  = sellQueue[bq_hash];
        Queue storage mqueue =  buyQueue[bq_hash];
        MatchedInfo memory mi;
        mi.is_sell = isSell(takerOrderParam.data);

        if(!mi.is_sell)
        {
            queue  =  buyQueue[bq_hash];
            mqueue = sellQueue[bq_hash];
        }

        // match sell / buy
        mi.baseTokenAmount = takerOrderParam.baseTokenAmount;
        mi.quoteTokenAmount = takerOrderParam.quoteTokenAmount;
        mi.count = get_match_count(mqueue, mi, takerOrderParam.baseTokenAmount);
        if(mi.count > 0)
            match_orders(mqueue, takerOrderParam, orderAddressSet, mi);

        // full match, never '<'
        if(takerOrderParam.baseTokenAmount <= mi.baseTokenFilledAmount)
        {
            delete orderFlag[od_hash];
            return ;
        }

        // use baseTokenAmount for 1 quote token
        QueueElem storage elem =  queue.elems[od_hash];
        elem.order = takerOrderParam;
        elem.filled = mi.baseTokenFilledAmount;

        // insert maker order
        insert_queue(queue, mi, od_hash);
        emit MakeOrder(bq_hash, od_hash);
    }

    /* get base-quote-hash
     * base: base token
     * quote: quote token
     * */
    function getBQHash(HybridExchange.OrderAddressSet memory orderAddressSet) public pure returns(bytes32 bq_hash)
    {
        bq_hash = keccak256(abi.encodePacked(
                                bytes32(uint256(orderAddressSet.baseToken)),
                                bytes32(uint256(orderAddressSet.quoteToken))));
    }

    /* get oder hash
     * */
    function getBQODHash(HybridExchange.OrderParam memory orderParam,
                       HybridExchange.OrderAddressSet memory orderAddressSet)
        public
        view
        returns(bytes32 bq_hash, bytes32 od_hash)
    {
        Order memory order;
        order.trader = orderParam.trader;
        order.baseTokenAmount = orderParam.baseTokenAmount;
        order.quoteTokenAmount = orderParam.quoteTokenAmount;
        order.gasTokenAmount = orderParam.gasTokenAmount;
        order.data = orderParam.data;
        order.baseToken = orderAddressSet.baseToken;
        order.quoteToken = orderAddressSet.quoteToken;
        order.relayer = orderAddressSet.relayer;

        // hash of base-quote
        bq_hash = keccak256(abi.encodePacked(
                                bytes32(uint256(orderAddressSet.baseToken)),
                                bytes32(uint256(orderAddressSet.quoteToken))));
        // hash of order
        od_hash = getOrderHash(order);
    }

    /* get order info
     * bq_hash: base-quote hash
     * od_hash: order hash
     * is_sell: true for sell, false for buy
     * */
    function getOrderInfo(bytes32 bq_hash, bytes32 od_hash, bool is_sell)
        public
        view
        returns (QueueElem memory)
    {
        if(is_sell)
            return sellQueue[bq_hash].elems[od_hash];
        else
            return  buyQueue[bq_hash].elems[od_hash];
    }

    /* cancel order
     * */
    function cancelOrder(HybridExchange.OrderParam memory takerOrderParam,
                         HybridExchange.OrderAddressSet memory orderAddressSet)
        public
    {
        (bytes32 bq_hash, bytes32 od_hash) = getBQODHash(takerOrderParam, orderAddressSet);
        bool is_sell = isSell(takerOrderParam.data);

        // exists
        require(orderFlag[od_hash]);

        // get queue
        Queue storage queue  = sellQueue[bq_hash];
        if(!is_sell)
            queue  =  buyQueue[bq_hash];

        // delete order
        remove_queue(queue, od_hash);

        emit CancelOrder(bq_hash, od_hash);
    }

    /* get data */
    function getConfigData(bool is_sell) public view returns(bytes32)
    {
        uint256 data;
        // version
        data = data | (SUPPORTED_ORDER_VERSION << (31*8));

        if(is_sell)
        {
            // side, maker-rate, taker-rate
            data = data | (1 << (30*8));
            data = data | (0x258 << (22 * 8));
            data = data | (0x258 << (20 * 8));
        }

        //expired
        data = data | ((block.timestamp + WEEK_SECONDS) << (24*8));


        return bytes32(data);
    }

    /* get signature
     * signMethod: signature method
     * */
    function getConfigSignature(bytes1 v,  bytes32 r, bytes32 s, uint8 signMethod)
        public
        pure
        returns(HybridExchange.OrderSignature memory sig)
    {

        sig.config = sig.config | bytes32(uint256(uint8(v)) << (31*8));
        sig.config = sig.config | bytes32(uint256(signMethod) << (30*8));
        sig.r = r;
        sig.s = s;
    }

    // set configuration
    function setConfiguration(string memory key, string memory value) public
    {
        configurations[key] = value;
    }

    // delete configuration
    function delConfiguration(string memory key) public
    {
        delete configurations[key];
    }

    // match sell/buy
    function match_orders(Queue storage queue,
                          HybridExchange.OrderParam memory taker,
                          HybridExchange.OrderAddressSet memory orderAddressSet,
                          MatchedInfo memory mi)
        internal
    {
        uint256 total = taker.baseTokenAmount;
        HybridExchange.OrderParam[] memory makerOrderParams = new HybridExchange.OrderParam[](mi.count);
        uint256[] memory baseTokenFilledAmounts = new uint256[](mi.count);

        uint256 i = 0;
        uint256 tmp;
        QueueElem storage elem = queue.elems[queue.start];
        while(queue.start != 0 && i < mi.count)
        {
            elem = queue.elems[queue.start];
            tmp = elem.order.baseTokenAmount.sub(elem.filled);
            if(total >= tmp)
            {
                mi.baseTokenFilledAmount = mi.baseTokenFilledAmount.add(tmp);
                total = total.sub(tmp);
                makerOrderParams[i] = elem.order;
                baseTokenFilledAmounts[i] = tmp;
                remove_queue(queue, queue.start);
            }
            else
            {
                mi.baseTokenFilledAmount = mi.baseTokenFilledAmount.add(total);
                elem.filled = elem.filled.add(total);
                makerOrderParams[i] = elem.order;
                baseTokenFilledAmounts[i] = total;
                i = i.add(1);
                break;
            }
            i = i.add(1);
        }
        require(i==mi.count, "matched count error");

        //require(makerOrderParams[0].baseTokenAmount==300, "base value error");
        //require(makerOrderParams[0].quoteTokenAmount==27, "quote value error");
        //require(baseTokenFilledAmounts[0]==50, "filled value error");
        _dex.matchOrders(taker, makerOrderParams, baseTokenFilledAmounts, orderAddressSet);
    }

    // insert sell/buy queue
    function insert_queue(Queue storage queue,
                          MatchedInfo memory mi,
                          bytes32 od_hash)
        internal
    {
        // empty queue
        if (queue.start == 0 &&
            queue.end == 0)
        {
            queue.start = od_hash;
            queue.end = od_hash;
            return ;
        }

        // best price
        QueueElem storage elem = queue.elems[queue.start];
        if(isBetterPrice(mi, elem.order, false))
        {
            queue.elems[od_hash].next = queue.start;
            queue.start = od_hash;
            return ;
        }

        // worst price
        elem = queue.elems[queue.end];
        if(!isBetterPrice(mi, elem.order, false))
        {
            elem.next = od_hash;
            queue.end = od_hash;
            return ;
        }

        // middle price
        bytes32 odh = queue.start;
        bytes32 next = queue.elems[odh].next;
        while(next != 0)
        {
            elem = queue.elems[next];
            if(isBetterPrice(mi, elem.order, false))
                break;

            odh = next;
            next = elem.next;
        }
        queue.elems[od_hash].next = next;
        queue.elems[odh].next = od_hash;
    }

    // get count of matched
    function get_match_count(Queue storage queue, MatchedInfo memory mi, uint256 total)
        internal
        view
        returns(uint256 count)
    {
        bytes32 odh = queue.start;
        bytes32 next = 0;
        uint256 tmp = 0;
        count = 0;
        while(odh != 0 && total > 0)
        {
            QueueElem storage elem = queue.elems[odh];
            next = elem.next;
            if(isBetterPrice(mi, elem.order, true))
            {
                count = count.add(1);
                tmp = elem.order.baseTokenAmount.sub(elem.filled);
                if(total >= tmp)
                {
                    total = total.sub(tmp);
                }
                else
                {
                    total = 0;
                    break;
                }
            }
            else
            {
                break;
            }
            odh = next;
        }
    }

    // remove sell/buy queue
    function remove_queue(Queue storage queue, bytes32 od_hash)
        internal
    {
        // empty queue
        if (queue.start == 0 &&
            queue.end == 0)
        {
            return ;
        }

        // best price
        if(queue.start == od_hash)
        {
            queue.start = queue.elems[od_hash].next;
            delete queue.elems[od_hash];
            if(queue.start == 0)
                queue.end = 0;
            return ;
        }

        // middle/worst price
        bytes32 odh = queue.start;
        bytes32 next = queue.elems[odh].next;
        while(next != 0)
        {
            if(next == od_hash)
                break;

            odh = next;
            next = queue.elems[odh].next;
        }
        queue.elems[odh].next = queue.elems[od_hash].next;
        delete queue.elems[od_hash];
        delete orderFlag[od_hash];
    }

    function isSell(bytes32 data) internal pure returns (bool) {
        return uint8(data[1]) == 1;
    }

    function isBetterPrice(MatchedInfo memory mi, HybridExchange.OrderParam storage makerOrderParam, bool is_match)
        internal
        view 
        returns (bool)
    {
        uint256 left = mi.quoteTokenAmount.mul(makerOrderParam.baseTokenAmount);
        uint256 right = mi.baseTokenAmount.mul(makerOrderParam.quoteTokenAmount);
        if (is_match)
            return mi.is_sell ? left <= right : left >= right;
        else
            return mi.is_sell ? left < right : left > right;
    }

}
